class Solution:

    def find_max(self, arr, i):
        mx = 0
        c = 0
        index_of_max = 0
        for el in arr[i+1:]:
            if el > mx:
                mx = el
                index_of_max = c
            c += 1
        return mx, i+index_of_max+1


    def replaceElements(self, arr: list) -> list:
        if len(arr) == 1:
            return [-1]

        # res = [0] * len(arr)
        # for i in range(len(arr) - 1):
        #     res[i] = max(arr[i + 1:])
        # res[len(arr) - 1] = -1
        res = list()

        i = 0
        while i < len(arr)-1:
            mx, index_of_mx = self.find_max(arr, i)
            res.extend([mx for j in range(i, index_of_mx)])
            i = index_of_mx
        res.append(-1)
        return res


